import React from "react";
import { Carousel } from "react-responsive-carousel";
// import NSA from "./images/nsaBuild.jpg";
import doctor from "../../pages/images/doctor.jpg";
// import trivia from "./images/triviaChuck.jpg";
// import biohazzard from "./images/biohazzard.jpg";
// import liri from "./images/liri.jpg";
// import claws from "./images/claws.jpg";

export default () => (
  <Carousel autoPlay>
    <div>
      <img width="250px" height="150px" src={doctor} alt="Doctor Kevorkian" />
      <p className="legend">Legend 1</p>
    </div>
    <div>
      <img width="250px" height="150px" src={doctor} alt="Doctor Kevorkian" />
      <p className="legend">Legend 2</p>
    </div>
    <div>
      <img width="250px" height="150px" src={doctor} alt="Doctor Kevorkian" />
      <p className="legend">Legend 3</p>
    </div>
    <div>
      <img width="250px" height="150px" src={doctor} alt="Doctor Kevorkian" />
      <p className="legend">Legend 4</p>
    </div>
    <div>
      <img width="250px" height="150px" src="http://lorempixel.com/output/cats-q-c-640-480-5.jpg" />
      <p className="legend">Legend 5</p>
    </div>
    <div>
      <img width="250px" height="150px" src="http://lorempixel.com/output/cats-q-c-640-480-6.jpg" />
      <p className="legend">Legend 6</p>
    </div>

  </Carousel>
);
